import React, { Component } from 'react';
import './main.css';

export default class Main extends Component {
    state = {
        titulo: "Game Fifteen",
        box: [],
    };

    render() {
        const { titulo, box } = this.state;
        return (
            <div className="border">
                <h1>
                    {titulo}
                </h1>
                <div className="Box">
                    {box}
                </div>
            </div>
        )
    }
}
